import React, { Component } from "react";
import CardDisplay from "../components/CardDisplay";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = { starWarsList: "" };
  }
  componentDidMount() {
    fetch("https://uifaces.co/api", {
      method: "GET",
      headers: {
        "X-API-KEY": ["1500B36D-DF494A0A-BF224E6F-84352346"],
        Accept: "application/json",
        "Cache-Control": "no-cache",
      },
    }).then((resp) => resp.json());
  }

  render() {
    return (
      <div className="App">
        <CardDisplay starWarsList={this.state.starWarsList} />
      </div>
    );
  }
}

export default App;
